`,paraId:3,tocIndex:0},{value:"So the props we set for ProFormText are actually for Form.Item, and the fieldProps are for the included Input, remember.",paraId:4,tocIndex:0},{value:"In addition to display type form items, we also provide form items for combining data:",paraId:5,tocIndex:0},{value:"ProFormList is basically the same as the ",paraId:6,tocIndex:1},{value:"Form.List",paraId:6,tocIndex:1},{value:" API. It adds its own operation buttons: delete and copy, and it also includes a ",paraId:6,tocIndex:1},{value:"new row",paraId:6,tocIndex:1},{value:" button.",paraId:6,tocIndex:1},{value:`<ProFormList
